PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "drink_categories" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "drinks" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" varchar, "image_file_name" varchar, "image_content_type" varchar, "image_file_size" integer, "image_updated_at" datetime, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "drink_category_id" integer);
CREATE TABLE "pub_drinks" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "price" integer, "description" varchar, "drink_id" integer, "pub_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "pubs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" varchar, "telephone1" varchar, "telephone2" varchar, "location" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "image_logo_file_name" varchar, "image_logo_content_type" varchar, "image_logo_file_size" integer, "image_logo_updated_at" datetime, "user_id" integer, "bank_name" varchar, "bank_account_type" varchar, "bank_account_number" varchar, "bank_account_rut" varchar, "bank_account_email" varchar, "order_index" integer);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "provider" varchar DEFAULT 'email' NOT NULL, "uid" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "confirmation_token" varchar, "confirmed_at" datetime, "confirmation_sent_at" datetime, "unconfirmed_email" varchar, "name" varchar, "nickname" varchar, "image" varchar, "email" varchar, "tokens" text, "created_at" datetime, "updated_at" datetime, "admin" boolean DEFAULT 'f', "super_admin" boolean DEFAULT 'f', "lastname" varchar);
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
DELETE FROM sqlite_sequence;
CREATE INDEX "index_drinks_on_drink_category_id" ON "drinks" ("drink_category_id");
CREATE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE UNIQUE INDEX "index_users_on_uid_and_provider" ON "users" ("uid", "provider");
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
